import React from "react";
import { Component } from "react";
import classes from "./Navbar.module.css";

class Navbar extends Component {
  render() {
    return (
      <div className={classes.header}>
        <nav>
          <ul className={classes.nav__links}>
            <li>
              <li>
                <a href="#">WOMEN</a>
              </li>
              <li>
                <a href="#">MEN</a>
              </li>
              <li>
                <a href="#">KIDS</a>
              </li>
            </li>
          </ul>
        </nav>
        <img src=""></img>
      </div>
    );
  }
}

export default Navbar;
